import React from "react";

export default function Pizzas({ pizza }) {
  return (
    <div>
      <h1>{pizza.name}</h1>
      <img
        src={pizza.image}
        className="img fluid"
        style={{ height: 200, width: 200 }}
      />
    </div>
  );
}
